import React from 'react';

const Home = ({ onLogin, onRegister }) => {
  return (
    <div className="container">
      <h1 className="title">Bienvenue sur A'rosa-je</h1>
      <p className="paragraph">Connectez-vous ou inscrivez-vous pour prendre soin de vos plantes!</p>
      <button className="button" onClick={onLogin}>Se connecter</button>
      <br />
      <button className="button" onClick={onRegister}>S'inscrire</button>
    </div>
  );
};

export default Home;
